import React, { Component } from "react";
import Hero from "./Hero";

class HeroList extends Component {
  render() {
    return (
      <div className="container col-6 min">
        {this.props.heroes.map(hero => (
          <div>
            <Hero hero={hero} />
          </div>
        ))}
        ;
      </div>
    );
  }
}

export default HeroList;
